    18,nt"tags": [],nt"title": "Dissolved inorganic carbon, alkalinity, temperature,
    salinity and other variables collected from discrete sample and profile observations
    using CTD, bottle and other instruments from the ODEN in the Arctic Ocean from 1991-07-26
    to 1991-09-03 (NODC Accession 0113591)",nt"tracking_summary": {ntt"total":
    1,ntt"recent": 1nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2015-09-27T00:17:43.170921",nt"name": "dissolved-inorganic-carbon-alkalinity-temperature-salinity-and-other-variables-collected-from-dc9999",nt"isopen":
    false,nt"url": null,nt"notes": "NODC Accession 0113591 includes chemical,
    discrete sample, physical and profile data collected from ODEN in the Arctic Ocean
    from 1991-07-26 to 1991-09-03 and retrieved during cruise CARINA/77DN19910726. These
    data include ALKALINITY, CHLOROFLUOROCARBON-11 (CFC-11), CHLOROFLUOROCARBON-12 (CFC-12),
    Carbon tetrachloride (CCL4), DISSOLVED INORGANIC CARBON, DISSOLVED ORGANIC CARBON,
    DISSOLVED OXYGEN, Delta Oxygen - 18, HYDROSTATIC PRESSURE, NITRATE, PHOSPHATE, Potential
    temperature (theta), SALINITY, SILICATE and WATER TEMPERATURE. The instruments used
    to collect these data include CTD and bottle. These data were collected by Leif
    Anderson of Gothenburg University; Department of Analytical and Marine Chemistry
    and J.E. Hellsvik [affiliation unknown] as part of the CARINA/77DN19910726 data
    set.nnThe CARINA (CARbon dioxide IN the Atlantic Ocean) data synthesis project is
    an international collaborative effort of the EU IP CARBOOCEAN, and U.S. partners.
    It has produced a merged internally consistent data set of open ocean subsurface
    measurements for biogeochemical investigations, in particular, studies involving
    the carbon system. The original focus area was the North Atlantic Ocean, but over
